import React, { useState } from 'react'
import Charts from 'react-apexcharts'

const CardGraph = () => {
    const [Data] = useState(
        {
           series:[85], 
           options : {
             chart:{
                 height:350,
                 type:'radialbar',
                 toolbar:{
                     show:true
                 }
             },
             plotOptions:{
                 radialBar:{
                     startAngle:-135,
                     endangle:225,
                     hollow:{
                         margin:0,
                         size:"70%",
                         imageOffsetX:0,
                         imageOffsetY:0,
                         position:'front',
                         dropShadow:{
                             enabled:true,
                             top:3,

                         }
                     }
                 }
             }
        }
    }
    )
    return (
        <div>
              <Charts options={Data.options} series={Data.series}  width="350" type='radialBar' />
        </div>
    )
}

export default CardGraph
